var app={loadBgResources:function(){console.log("ok")},showItems:function(){var e=document.querySelectorAll(".js-items"),t=e.length,n=0;setTimeout(function(){var o=setInterval(function(){t>n?(e[n].style.opacity=1,e[n].style.transform="translate(0,0)",n++):clearInterval(o)},100)},1e3)},menuToggle:function(){for(var e=document.querySelectorAll(".js-menu-item"),t="menu__item_state_active",n=0;n<e.length;n++)e[n].addEventListener("click",function(){for(var n=0;n<e.length;n++)e[n].classList.remove(t);this.classList.add(t)})}};app.init=function(){this.loadBgResources(),this.showItems(),this.menuToggle()},document.addEventListener("DOMContentLoaded",app.init());